#include "../src/distrs.h"

#define EPS 1e-5

int test_fn(double *x, double *y, size_t n, double (*f)(double x), char *name)
{
    for(int i=0; i < n; i++) {
        if(abs(y[i] - f(x[i])) > EPS) {
            printf("%s failed: expected %f at %f, got %f\n",
                   name, y[i], x[i], f(x[i]));
            return 0;
        }
    }
    printf("%s as expected.\n", name);
    return 1;
}


